import React from 'react';
import './App.css';
import Imessage from './Imessage';
import Sidebar from './Sidebar';


function App() {
  return (
    <div className="app">
      <h1> let's build iMessage app</h1>
      <Imessage />
      <Sidebar />
    </div>
  );
}

export default App;
